INSERT INTO `joinTourDays` VALUES (1,'Departure from Leh','',1),(2,'Day 6 - leh to stoke village','',1),(3,'Day 5 - Pangong to Leh','',1),(4,'Day 4 - Nubra to Pangong Tso','Depart for Pangong Tso, a beautiful high altitude lake that lies on the border between India and China\nEn route, visit the Chemrey Gompa and the Panamic hot spring\nArrive at Pangong Tso and check into your guesthouse\nTake a walk around the lake to enjoy the stunning views\nDinner and overnight stay near Pangong Tso',1),(5,'Day 3 - Leh-Nubra','Depart for Nubra, a beautiful valley known for its stunning landscapes and unique culture\nEn route, visit the Khardung La pass, which is considered the highest motorable road in the world\nVisit the Diskit Gompa, which is situated on a hilltop and offers a panoramic view of the valley\nArrive in Nubra and check into your guesthouse\nRide a double-humped Bactrian camel in the sand dunes of Hunder\nDinner and overnight stay in Nubra',1),(6,'Day 2 - Leh Local Exploration','Visit the famous Shanti Stupa, which offers a panoramic view of the city and the surrounding mountains and which was built to commemorate the 2500 years of Buddhism.\nVisit the Leh Palace, the former residence of the royal family of Ladakh\nVisit the Sankar Gompa, which is known for its intricate frescoes and beautiful statues\nIn the afternoon, visit the Hemis Gompa, one of the most important monasteries in Ladakh\nDinner and overnight stay in Leh',1),(7,'Day 1 - Arrival at Leh','~ Arrive at Leh Airport and transfer to hotel\n~ Take some rest and acclimatize to the high altitude (Leh is at an altitude of 11,500 feet)\n~ In the afternoon, take a short walk around the local market\n~ Dinner and overnight stay in Leh',1),(8,'Day 7 : Departure - Bid Adieu to the Magical Place','Get transferred to the airport from your hotel \nReturn home with a bagful of memories',2),(9,'Day 6: Return to Leh - A Visit to Rancho\'s School','Start your day with a beautiful view of Pangong Lake and begin your journey back to Leh via Chang La pass, which is located at an altitude of 17,590 feet.\nAlong the way, make a stop at the Druk White Lotus School, which gained fame as the location of the final scene in the movie \"3 Idiots\".\nAlso, visit the Thiksey Monastery, the largest Tibetan monastery in Ladakh which houses several stupas, statues and other Buddhist artifacts in its 12-story structure.\nUpon arrival in Leh, enjoy a delicious dinner at the hotel and overnight stay.',2),(10,'Day 5: Nubra Valley to Pangong Lake - A Color-Changing Beauty','Begin your day with breakfast and embark on a journey to Pangong Lake, a major attraction in the region located on the Indo-China border\nTake in the picturesque scenery of the Shyok River on one side and the mountains on the other. \n Known for its high altitude saline water, the lake changes colors from shades of blue, green and red. Pangong Tso, in Tibetan culture, means \"high grassland lake\".\nRelive the famous Bollywood moments from movies like 3-idiots and Jab Tak Hai Jaan\nEnd the day with an overnight stay at a campsite near Pangong Lake/Tangste.',2),(11,'Day 4: Nubra Valley to Turtuk Village - The Last Outpost of India','After a hearty breakfast, leave Hunder and embark on a journey towards Turtuk\n This unique destination offers a distinct cultural, linguistic, and historical experience compared to what you have seen so far on your Ladakh holiday. \nExplore the picturesque landscape of dramatic narrow valleys and steep mountains that are different from Central Ladakh and Nubra. \nTurtuk is famous for its apricot and you can bring home some of the fresh apricots\nVisit the Thang village, which is the last village and after which is Gilgit Pakistan.\nIn the evening, return to Hunder and enjoy a delicious dinner, before camping overnight in the valley.',2),(12,'Day 3: Leh to Nubra Valley','Wake up to the beautiful morning and leave for Nubra at around 8.30 am in the morning\nVisit  the second highest motorable pass in the world, Khardung La. The drive offers some spectacular views of the Himalayan mountain range.\nGet refreshed as you reach Khardung and then continue towards Khalsar where you can also indulge in river rafting in Shyok river\nEn route Nubra valley, visit the famous Diskit monastery known for its beautiful frescoes and statues and offers a glimpse into the traditional Tibetan culture\nIf you want, you can indulge in ATV rides which is a popular activity in the region',2),(13,'Day 2: Leh Local Sightseeing','Start the day by visiting the Hall of Fame, a museum dedicated to the Indian soldiers who served in the region. \nNext, visit Spituk Monastery, a Buddhist monastery of the Red Hat sect. The monastery is located on a hilltop and offers panoramic views of the surrounding area.\nAfter that, visit Pathar Sahib Gurudwara, a Sikh temple built in memory of Guru Nanak Dev Ji. The temple is known for its beautiful architecture and serene atmosphere.\nIn the afternoon, visit Magnetic Point. It is a spot on a hill where vehicles appear to defy gravity and move uphill when parked in a specific marked area, due to an optical illusion.\nFinally, visit Sangam Point, the confluence of the Indus and Zanskar rivers. It is a peaceful spot and offers a great opportunity to see the two rivers meet.\nOvernight stay at a hotel in Leh.\n.',2),(14,'Day 1: Arrival in Leh','Arrive at Leh airport and transfer to the hotel. It is recommended to take rest and acclimatize to the high altitude, as Leh is located at an altitude of 11,500 feet.\nYou can spend the rest of the day exploring the local market,Leh palace and Shanti Stupa and take in the unique culture and beauty of the region.\nOvernight stay at a hotel in Leh.',2),(15,NULL,NULL,3),(16,NULL,NULL,3),(17,NULL,NULL,3),(18,NULL,NULL,3),(19,NULL,NULL,3),(20,NULL,NULL,3),(21,NULL,NULL,3),(22,NULL,NULL,4),(23,NULL,NULL,4),(24,NULL,NULL,4),(25,NULL,NULL,4),(26,NULL,NULL,4),(27,NULL,NULL,4),(28,NULL,NULL,4),(29,NULL,NULL,4),(30,NULL,NULL,4),(31