coldest inhabited village in the world\nMake a stop at Kargil War Memorial to pay homage to the martyrs of Kargil war\nCross the mighty Zojila Pass to finally reach Srinagar\nCheck-in to your hotel\nYou can explore the local places of Srinagar on your own\nOvernight stay in Srinagar',22),(233,'Leh to Kargil','After a hearty breakfast, get ready for an adventurous ride to Kargil\nEn route visit one of the monastic jewels of Ladakh, the Alchi monastery\nVisit the Lamayuru village, and observe the eventual transition of landscape\nVisit other places including Basago Palace and Giant Buddha Of Mulbek\nReach Kargil and call it a day\nOvernight stay in Kargil',22),(234,'Pangong to Leh','Start the day by riding back to Leh.\nAlong the way, visit Druk White Lotus School, which was featured in the movie ‘3 Idiots’. The school is known for its innovative and modern approach to education.\nNext, visit Thiksey Monastery, a Buddhist monastery of the Yellow Hat sect. The monastery is known for its beautiful architecture and is home to many ancient manuscripts and artifacts.\nAfter visiting the monastery, visit Shey Palace, a 17th century palace and the former residence of the kings of Ladakh. The palace is known for its beautiful frescoes and offers a glimpse into the history and culture of the region.\nOvernight stay in Leh.',22),(235,'Nubra to Pangong','Wake up to the beautiful morning of Nubra and after breakfast head towards the highest saltwater lake in the world, Pangong Tso\nEn route Pangong, cross local villages like Durbuk and Tangze. You can have your lunch at either of these two villages\nUpon reaching Pangong Tso, be mesmerized at the turquoise beauty of the lake which happens to create an illusion of changing shades of colors\nOvernight stay in Pangong Tso',22),(236,'Leh to Nubra','Depart for Nubra, a beautiful valley known for its stunning landscapes and unique culture\nEn route, visit the Khardung La pass, which is considered the highest motorable road in the world\nVisit the Diskit Gompa, which is situated on a hilltop and offers a panoramic view of the valley\nArrive in Nubra and check into your homestay\nRide a double-humped Bactrian camel in the sand dunes of Hunder\nDinner and overnight stay in Nubra',22),(237,'Leh to Local Sightseeing','Visit the famous Shanti Stupa, which offers a panoramic view of the city and the surrounding mountains and which was built to commemorate the 2500 years of Buddhism.\nVisit the Leh Palace, the former residence of the royal family of Ladakh\nVisit the Sankar Gompa, which is known for its intricate frescoes and beautiful statues\nIn the afternoon, visit the Hemis Gompa, one of the most important monasteries in Ladakh\nDinner and overnight stay in Leh',22),(238,'Sarchu to Leh','',22),(239,'Manali to Sarchu','After having your breakfast at Manali, head towards Sarchu\nOn your way to Sarchu, you will be cross one of the most fascinating passes in India, Baralacha La pass(4980 m)\nOn your arrival at Sarchu,check-in to your cozy camp \nYou can stroll in and around Sarchu and explore the charm of the village’\nOvernight stay in Sarchu',22),(240,'Arrival in Manali','Arrival at Manali and complete the check-in procedure at the hotel\nIn the evening, you are free to explore the local market and visit the Hadimba Devi temple\n Overnight stay in Manali',22);
