INSERT INTO `joinTourMaster` VALUES (1,'2204LL6NUBG','LEH-LEH 6N/7D with Stoke Village ',7,51,51,'Backpacking',24,'18-68','Ladakh',10,'17999','167502601720190520_185909.jpg',1,'2023-02-17 23:48:42',1,'','','','','','','Mismiraising Ladakh with locals ','','','','Tickets of museum\r\nExtra stay increment Customer can direct contact\r\nBikes will be allowed in group travel only, Not for personal use after\r\n ',NULL,'Tripvola Assured Departures','Ground Operation Team','Value for Money',1,'',30,''),(2,'LL6NGTT','6N/7D Leh to Leh with Turtuk ',7,51,51,'Backpacking',24,'18 - 68','Tempo Traveler',11,'18999','1676439634pexels-shalender-kumar-6619053.jpg',1,'2023-03-15 15:17:05',1,'','','','','# Visit the beautiful Pangong Tso, the highest saltwater lake in the world\r\n# Cross Khardung La, which is the second-highest motorable pass in the world\r\n# Ride on the back of rare specie double humped Bactrian camel found exclusively in Nubra\r\n# Visit the last villages of India, Turtuk & Thang Village\r\n# Experience the local charm of Ladakh as you visit Spituk monastery, Leh Palace, Shey Palace, Diskit monastery, Thiksey monastery, and more\r\n\r\n','Accommodation\r\nMeals ( 6 Breakfast & 6 Dinners)\r\nSightseeing as per itinerary\r\nTransfers on Tempo Traveler\r\nOxygen cylinder \r\nAll permits & Tolls\r\n','ladakh trip','','','','Flight\r\nEntry Tickets\r\nActivities\r\nPersonal Expenses\r\n',NULL,'Tripvola Assured Departures      ','Ground Operation Team','Value for Money',0,'',15,''),(3,'LL6NGXU','6N/7D Leh to Leh with Stok',7,51,51,'Fixed Group Departure',24,'18-69','MUV',10,'22500','1676660611AdobeStock_267219153_Preview.jpeg',1,'2023-02-18 21:16:08',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'From stunning high-altitude lakes to soaring mountain passes, this region offers an array of captivating experiences for travelers. A visit to Ladakh is incomplete without experiencing the unique beauty of Pangong Tso, the highest saltwater lake in the world, and crossing Khardung La, the second highest motorable pass in the world. A truly unforgettable experience is the chance to ride on the back of a rare species of double-humped Bactrian camel, found exclusively in Nubra. To taste the authentic flavors of Ladakhi cuisine, you will also visit a local family’s house in Stok and indulge in a traditional meal. Ladakh is also home to several ancient and mesmerizing monasteries, such as Spituk, Leh Palace, Shey Palace, Diskit, Thiksey, and more.','Tripvola Assured Departures','Ground Operation Team','Complimentary Local Ladakhi Cusine ',0,'',30,''),(4,'DD11NGTT','11N/12D Delhi to Delhi - Leh Ladakh  Backpacking Group Departure ',12,40,56,'Backpacking ',24,'18 - 68','Volvo + Tempo Traveler',11,'31499','joinintour.png',1,'2023-03-15 15:16:43',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tripvola Assured Departures      ','Handpicked Stays ','Value for Money',0,'',30,''),(5,'DD11NGTT','11N/12D Delhi to Delhi - Leh Ladakh  Backpacking Group Departure ',12,40,56,'Backpacking ',24,'18 - 68','Volvo + Tempo Traveler',10,'31499','joinintour.png',499,'2023-02-18 21:30:10',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tripvola Assured Departures      ','Handpicked Stays ','Value for Money',1,'',30,''),(6,'DD11NGTT','11N/12D Delhi to Delhi - Leh Ladakh  Backpacking Group Departure ',12,40,56,'Backpacking ',24,'18 - 68','Volvo + Tempo Traveler',10,'31499','joinintour.png',499,'2023-02-18 21:30:13',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tripvola Assured Departures      ','Handpicked Stays ','Value for Money',1,'',30,''),(7,'DD11NGTT','11N/12D Delhi to Delhi - Leh Ladakh  Backpacking Group Departure ',12,40,56,'Backpacking ',24,'18 - 68','Volvo + Tempo Traveler',10,'31499','joinintour.png',499,'2023-02-18 21:30:15',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tripvola Assured Departures      ','Handpicked Stays ','Value for Money',1,'',30,''),(8,'DD11NGTT','11N/12D Del