NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tripvola Assured Departures      ','Handpicked Stays ','Value for Money',1,'',30,''),(20,'12345','Manali Tour ',5,40,54,'Adventure',36,'45','Ladakh',11,'1600','joinintour.png',1,'2023-02-23 18:32:20',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',1,'',1,''),(21,'8880','Nepal',12,40,47,'',0,'','',11,'12000','joinintour.png',1,'2023-02-23 13:32:00',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',1,'',20,''),(22,'MS9NGB','Manali-Leh-Srinagar Bike Departure 9N/10D dcoihcuhefviubfviubiujvbgbgvjgnvokjgrno jngjbngrkbnrkbntrkmnbmnvbopmnrgrokbn',10,54,55,'Adventure Riding',24,'18 - 55','Himalyan / Enfield 500CC',11,'33499','1677184185rider-g3b59d4376_1920.jpg',1,'2023-02-24 03:29:09',1,'','','','','# Visit Pangong tso, the highest saltwater lake in the world\r\n# Cross Khardung La, considered to be the second-highest motorable pass in the world\r\n# Cross Baralacha La Pass and experience a journey through the Atal tunnel\r\n# Experience the local charm of Ladakh as you visit Spituk monastery, Leh Palace, Shey Palace, Diskit monastery, Thiksey monastery and more\r\n# Ride on the back of rare specie double humped Bactrian camel found exclusively in Nubra\r\n# Visit Druk Lotus school, where the famous movie 3 Idiots was filmed\r\n# Pass through Dras village, the second coldest inhabited village in the world\r\n\r\n','Standard Accommodation \r\nMeals (9 dinners + 9 breakfast )\r\nSightseeing as per the itinerary\r\nBike (Enfield 500cc or Himalayan) & fuel\r\nFriendly Marshal\r\nMechanic\r\nBack-up vehicle\r\nOxygen cylinder & basic medical amenities\r\nBonfire in Nubra\r\nAll permits & Toll\r\n','Manali-Leh-Srinagar Bike Departure 9N/10D','','','','Flights\r\nPersonal expenses\r\nEntry tickets\r\nLunch\r\nActivities\r\nAny personal expenses \r\nAny extra cost applicable due to natural calamities\r\nAnything which is not mentioned under inclusions\r\n\r\n','This itinerary is a feast for the senses, taking you on an unforgettable adventure through stunning landscapes, remote villages, and ancient monasteries. From the highest saltwater lake in the world to the second highest motorable pass, you\'ll witness some of the most breathtaking natural wonders on the planet. But this journey is not just about the sights; it\'s also an opportunity to immerse yourself in the local culture and experience the warmth and hospitality of Ladakh\'s people. Get ready to ride on the back of a rare double-humped Bactrian camel, visit iconic film locations, and traverse the famous Atal tunnel. Join us as we take you on an exhilarating ride through the mystical land of Ladakh.','Tripvola Assured Departures      ','Ground Operation Team','Value for Money',1,'',15,'');
