INSERT INTO `userMaster` VALUES (1,0,0,'tripvola ','CRM','crm@tripvola.com','a1038774880240f3203697dac07d3bfa','',1,1,'9654907178','9654907178','','www.webfreezesolution.com','2016-11-17','New Delhi','Delhi','Delhi','','india','Bee CRM Pvt. Ltd.','',500,'2060-06-23',1,1,1,0,1,20172017,0,0,1,1,'1673866560png red-removebg-preview.jpg',1567196714,1,1567198290,1,1,'2023-03-26 08:38:35','2023-03-22 00:42:49','2405:201:5c0a:4f2f:d9e8:5fda:b343:a322','2405:201:5c0a:4f2f:210d:634d:1733:827a','','','101934',0,0,0,'MMT CRM','http://webfreezesolution.com/newmmt/','mohd.m.imran@gmail.com','mohd.m.imran@gmail.com','#0c7be0','#368ae7','#f0f0f0','#ffffff','#ffffff','#000000','350','We are live and ready to chat with you now.','Please fill out the form below and we will get back to you as soon as possible.','Welcome to our site, if you need help simply reply...',30,'Online - Customer Support',1,2,'travBizz','crm@travbizz.com','admin@3214','smtp.travbizz.com','465','true','tripvola','letstalk@tripvola.com','9664392315','B4/246, Basement, Safdarjung Enclave, New Delhi 110029','Bank Details:\r\nAc. Name: travBizz\r\nC/A No.: 400-001-038-2 \r\nBank of Ayudhya \r\nChok Chai 4 Branch, Bangkok \r\nSwift: AYUDTHBK\r\n\r\n** Kindly ensure that the amount Invoiced has been paid in full 15 days prior to the client\'s arrival date. Failure to do so might result in the cancellation of the booking made. \r\n\r\n** This is an E-invoice, No official signature or stamp is needed.','1676400659png black.png','All vouchers issued are on the condition that all arrangements operated by persons or bodies are made as agents only and that they shall not be responsible or any damage, loss, injury, delay or inconvenience caused to passengers as a result of any such arrangements. We will not accept any responsibility for additional expenses due to the changes or delays in air, road, rail, sea or indeed any other causes, all such expenses will have to be borne by passengers.',NULL,'0',NULL,NULL,'A. Entrance fees of the scenic spots as listed in the itinerary.\r\n\r\nB. Meals as specified in the itinerary.\r\n\r\nExceptions: If the western breakfast is not available in some of the hotels, breakfast would be either\r\n\r\nChinese breakfast or Chinese and western breakfast.\r\n\r\n* Some set menu meals might be arranged for the tour convenience en route. Each meal provides one cup of a soft drink per person.\r\n\r\n* You will be ordering dishes at a local restaurant with guideâ€™s help when a la carte meals listed in the itinerary. The allowance would be adequate for a decent meal (including dishes and soft drinks) in our recommended local restaurants. A supplemental payment may be charged for any deficiency.\r\n\r\n* Children\'s a la carte meals: Free for under 2 years old, 25% off for 2-11 years oldï¼Œand full price for above 12 years old.\r\n\r\nC. Hotels: Hotel based on two persons sharing one room with twin beds or a king size bed; all hotels as listed in the above itinerary serve daily western or Chinese breakfast; please note double bedroom is on request basis which is subject to Hotel\'s availability and re-confirmation upon check-in.\r\n\r\n* Service, room facilities and breakfast might be not up to standard in some remote areas.\r\n\r\n* Check-in & Check-out time: generally check-in is after 2 pm and check-out before 12 pm (noon). Early check-in and late check-out are subject to hotel availability and may result in an extra charge equivalent to one full day room rate.','A. Flight not listed in the Price Includes.\r\n\r\nB. Accommodation not as listed in the itinerary.\r\n\r\nC. Visa Fees: Please make sure that you have got your valid passport and visa before your entry to China. We can send you a free official invitation letter to assist you in obtaining your visa after the reservation deposit is received.\r\n\r\nD. Sightseeing not listed in the itinerary.\r\n\r\nE. Meals not listed in the itinerary.\r\n\r\nF. Personal expenses such as room service, internet charge, laundry, drink, fax, telephone call, optional activities, etc.\r\n\r\nG. Gratuities, tips to guides, drivers, bellboys, etc.','A.  Payment to be made directly to the cashier in our office. Company\'s printed official receipt, duly sign by the Cashier must be obtained against payment made in Cash / Cheques as it will be considered as the only valid evidence for such payment. All Cash payments above Rs.50,000.00 require PAN Card Copy. No Cash Payments Accepted above Rs.2.00 Lakhs.\r\n\r\nB.  All Cheques / Demand Drafts in payment of bills should be drawn in favour of Company Name on Bombay Banks Only, and should be \"A/c Payee Only\".\r\n\r\nC . It will be deemed that you have accepted this bill in full in the event that you have not lodged any written objection with us within 5 days of the date there of.\r\n\r\nD . Payment due under this bill is payable at New Delhi.\r\n\r\nE . Interest @ 18 % per annum will be payable by you on the amount under this bill remaining unpaid after 15 days.\r\n\r\nF.  Subject to the Jurisdiction of Delhi Courts only.','English',0,'','This is just a quote, no reservations or bookings have been made.\r\n- The rooms & rates are subject to availability at the time of booking/confirmation.\r\n- Hotel, Sightseeing, Meals, Transfers rate might change without any prior notice until & unless it has been booked/ confirmed.\r\n- The change in dates will attract re-quote.\r\n- Normal Hotel check-in time is from 14.00 hrs onwards. & check-out time is at 12.00 hrs.\r\n- Additional Bank charges will be applicable if payment is made in foreign currency.\r\n- The above cost does not include any kind of surcharge if applicable during the given travel period.\r\n- There will be an additional Midnight Surcharge for all transfers between 23:00 - 07:00 hrs (if not stated inside the package).\r\n- The Quotation might change due to currency ROE fluctuation during the confirmation & booking process.\r\n\r\n *** This quote is generated by the system. If you have any questions regarding the quote please contact your Company Service Representative.','After Clearing Immigration and after collection of baggage, please proceed to the MEETING POINT in the arrival hall. (Please do not go outside the Airport gate).\r\n\r\n- Suvarnabhumi Airport-Between Exit Gate 3 & 4 near Information center. \r\n- Don Muang Airport -Exit Gate 5 - Next to King Power Shop \r\n- Phuket Airport (International) - Between Exit Gate 3 & 4  Next to Information center.\r\n- Phuket Airport (Domestic) - Exit Gate 1 near PP Mart-Meeting Point.\r\n- Changi Singapore Airport - Meeting Point near the information desk.\r\n- Kuala Lumpur Airport -Meeting Point near the information desk.\r\n- Bali DPS Airport -Meeting Point near the information desk\r\n\r\nCoach Arrivals: Guests are requested to kindly call on +65 86848694, as you leave after clearing Singapore Immigration to reconfirm your arrival pickup from coach terminal. \r\n\r\nIn case of early / delayed arrival of the Flight / Coach / Cruise, Guests are requested to please give some time  to rearrange the pickup as per the new timings. Additional charges may apply.\r\n\r\nIf required you can request the information desk in the arrival hall to assist you in calling the: \r\n- Bangkok Suvarnabhumi Airport Representative: +66 91 709 9378 \r\n- Don Muang Airport Representative: +66 91 709 9378\r\n- Phuket Airport Representative: +66 88 753 2067\r\n- Krabi Airport Representative: +66 62 412 4620 \r\n- Bali Airport Representative:  +62 817 972 6168 \r\n- Kuala Lumpur Airport Representative: +60 11 2645 1342 \r\n- Singapore Airport Representative: +65 86993089\r\n\r\nYou are requested to please proceed to the arrival hall at earliest as the arrival pickup will not wait for more than 1.5 Hours at the Maximum. \r\n\r\nHOTELS: \r\n1. Standard check-in time is after 1400 Hrs and check-out time is 1200 Hrs. However, this may vary from hotel to hotel. \r\n\r\n2. Hotels have a policy of collecting deposit from the guests upon check-in. This deposit would be refunded at the time of check-out if there are no additional / extra services which are not included or part of the package, utilised during the stay. \r\n\r\n3. Local taxes (Tourism, City taxes and/or any other taxes as applicable) needs to be paid to the hotel directly by the guest at the time of check-in.\r\n\r\nROOMS : \r\n1. Room request for a Double or a Twin is subject to availability at the time of check-in.\r\n\r\n2. An extra bed in a Triple room can be a roll away bed / sofa-cum-bed / single bed.\r\n\r\nTRANSFER AND ATTRACTIONS:\r\nSIC â€“SIC tours stands for Seat-in-Coach Basis Tours, which means you will share an air-conditioned coach or van with other guests. During the pickup for all transfers, there is a high chance of delay between (15 to 20) min as the driver will have 2 to 3 hotels to pick up.\r\nIf the guest from the first hotel delays, the rest of the pickup will get delayed as well. As such, the pickup coming for you wonâ€™t be able to wait for more than 5 minutes.\r\n\r\nPRIVATE TRANSFER (PVT)-Kindly report at the hotel lobby at the given time for all your tours and transfers. The pickup would wait for only 15 minutes. After which he would depart and you will have to manage to reach attraction or destination on your own. This service is based on fixed point to point schedule as per the itinerary only.\r\n\r\nThere could be change in Itinerary due to unforeseen circumstances like Natural Calamities, Civil Disturbances, Accidents, or any other events which are beyond our control.\r\n\r\nAny sightseeing missed due to such events, we will try to reschedule but same cannot be guaranteed and will depend on situation at that time.\r\n\r\nWe are not responsible for any loss arising out of any thefts of belongings / accidents or any other items of personal nature during your stay.','Emergency Contact: +9199414193331','admin@3214',0,0,88735,'','','','','',''),(494,3,12223,'Webfreeze Solution',NULL,'azhar@travbizz.c